{'Nom': 'Apparition', 'Categorie': 'Apparition allows giving names
  to paths, so that moving to the specific path can be done by using the name;
  it also allows managing the list of assigned names.', 'Url': 'https://github.com/david-haerer/apparition#', 'Description': '
  Directory changers (alternatives to cd)'}

{'Nom': 'asn', 'Categorie': 'Server
  for the following services: ASN, RPKI validity, BGP stats, IPv4v6, Prefix,
  URL, ASPath, Organization, IP reputation, IP geolocation, IP fingerprinting,
  Network recon, lookup API server, Web traceroute server.', 'Url': 'https://github.com/nitefood/asn#', 'Description': '
  Networking'}

{'Nom': 'gcp', 'Categorie': "(Goffi's
  cp) - an advanced file copier tool, heavily inspired from the traditional cp
  command, but with some additional features: Displays the copy progress
  indicator, with estimated time, current file speed; logs of all actions;
  resume of interrupted copy processes.", 'Url': 'https://github.com/aelafifi/gcp#', 'Description': 'File and file system handling'}

{'Nom': 'maxima', 'Categorie': 'Maxima is a manipulation system
  for symbolic and numerical expressions, including differentiation,
  integration, Taylor series, Laplace transforms, ordinary differential
  equations, systems of linear equations, polynomials, sets, lists, vectors,
  matrices and tensors.', 'Url': 'https://maxima.sourceforge.io/#', 'Description': 'Calculators'}

{'Nom': 'Midnight Commander', 'Categorie': 'A
  visual file manager, full-screen text mode application that allows you to
  copy, move and delete files and whole directory trees and search for files;
  includes an internal viewer and editor.', 'Url': 'http://www.midnight-commander.org/#', 'Description': 'File manager'}

{'Nom': 'ssam', 'Categorie': 'Ssam, short for
  split sampler, splits one or more text-based input files into multiple sets
  using random sampling. This is useful for splitting data into a training,
  test and development sets.', 'Url': 'https://github.com/proycon/ssam#', 'Description': 'Text processing'}
